module.exports = {"chooseLangWindow":{"title":"Attention","text":"Original website language is traditional Chinese, for I deliberately made it this way from the design perspective. Scroll through the Chinese version at least once. You can then change site language to your mother tongue in menu (last menu item).\nNevertheless if you want to get the understandable information right now, please click the button below.","setLangBtnText":"View in English","leaveLangBtnText":"Continue in Chinese"},"design":{"title":"Chinese websites design","description":"A few simple ideas that should make chinese websites more beautiful.","blockDummyText":"Material for this section is being composed"},"menu":{"design":"Design","portfolio":"Portfolio","cv":"CV","contacts":"Contacts","chooseLanguage":{"btnText":"Language","inputDummyText":"Choose language","changeLangBtnText":"Change language","blockTitle":"Choose language"}},"portfolio":{"blockTitle":"Portfolio","blockDescription":"Here are a few projects worth showing off"},"projectCard":{"viewMoreTxtDesktop":"Expand card","viewMoreTxtMobile":"Click again please"},"bfBot":{"title":"Flower shop Telegram bot","description":"A Telegram bot for my auntie’s flower shop, that lets the customer check out goods in stock, get company info and order a desired bouquet. Order process comprises the following steps: date input, time input, choosing shipping method, choosing a desired bouquet. The customer can either pay in the shop during the reception or right inside Telegram using Telegram Payments"},"cards":{"title":"Cards for displaying goods","description":"It was a test assignment for one local company. The objective was to get a list of goods via AJAX and display it according to an intrinsic sense of beauty. I chose cards to display the received data for they’re vivid, independent and elaborate. The visual implementation was driven by the inspiration of iOS smooth-moving elements, thus every tiny arrow, every list, title on this page appear, rotate as smooth as possible."},"calculator":{"title":"JS-made \"Calculator\" game","description":"It was the first serious project I’ve ever made – not just static page layouts, but also functionality implemented with js. I had a game on my cellphone where you were given a target number, that you should get, initial number, a number of steps and available mathematical operations (\"+2\", \"/3\" etc.). Your goal was to get the target number using mathematical operations at a restricted number of steps.\nI wrote down the game features and implemented It using the programming language I was learning at that time. Unfortunately, not all features I managed to implement (ex: \"level switch\"). I’m planning to add level constructor in the near future."},"thisApp":{"title":"Portfolio","description":"Gotta show what I’m capable of. I came up the portfolio-site, that stores my projects, CV not like the one with a *.docx extension and my contact info. In order to get additional points for my competence I’ve learned Vue.js framework and used it to implement the site behavior and logic. Material Design guide was used as a basis for component construction."},"projectViewBlock":{"projectLinksTitle":"Project links","techStackBlockTitle":"Tech stack","btnText":"Checkout"},"cvBlock":{"title":"CV","description":"Useful information for hiring me"},"checkoutCertificateBtnText":"Certificate","education":{"title":"Higher education","description":"have the following diplomas","data":{"univ1":"Tomsk Polytechnic University (2013 - 2018)","univ2":"Harbin Institute of Science and Technology (2017)"}},"spokenLanguages":{"title":"Spoken languages","description":"Can read docs and chat in these languages","data":{"lang1":"English (fluent: IELTS 6.9)","lang2":"Mandarin (fluent: HSK5)"}},"courses":{"title":"Courses","description":"Keen on learning, for free and for money"},"techStack":{"title":"Technology stack","description":"Can operate with the following tech"},"graphicSoftware":{"title":"Graphic software skills","description":"Can extract and icon and a typeface from the file unless it has a *.docx extension"},"coreSkills":{"title":"Core skills","description":"Use them at work","data":{"skill1":"Adaptive layouting","skill2":"Crossbrowser layouting","skill3":"UI/UX basics"}},"nonCoreSkills":{"title":"Non-core skills","description":"Use them in life","data":{"skill1":"sense of beauty","skill2":"Moderate perfectionism"}},"extra":{"title":"Other","description":"What else can I demonstrate","data":{"extra1":"Lived and studied in China (2017 - 2018)","extra2":"Teaching English in Russia and China","extra3":"Teaching the Chinese English remotely (2017 – настоящее время)"}},"about":{"title":"About me","data":"Love solving untrivial tasks and creating applicative products. It doesn’t matter what the project is about. It can be a bot or a flower shop, Chinese swearing generator or table booking system – most import is that the product must be beneficial to people and it’s implementation would require blowing one’s brains."},"contactInfo":{"title":"Contact info","description":{"line1":"My name is","line2":"and here's how you can contact me","name":"Gleb"}},"socialNetworks":{"title":"Via social networks"},"email":{"title":"Via e-mail","writeLetterBtnText":"Compose a letter"},"footer":{"text":"Designed and developed","authorNick":"Mayor"}};

